import Nav from 'react-bootstrap/Nav';
import '../css/Navbar.css';
import React from 'react';

function Navbar() {

    const nav_items_left = [
        {title: "Hem",              props: {activeKey: "home",      href: "#home" }},
        {title: "Pub & Event",      props: {activeKey: "events",    href: "#events"}},
        {title: "Klubbmästeriet",   props: {activeKey: "km",        href: "#km"}},
        {title: "Kontakt",          props: {activeKey: "contact",   href: "#contact"}}
    ];

    const nav_items_right = [
        {key: "login", title: "Logga in", href: "#login"},
    ];

    const content_left = nav_items_left.map((item) => NavItem(item.title, item.props));
    const content_right = nav_items_right.map((item) => NavItem(item.title, item.props));

    return (
        <Nav className={"clearfix"}>
            <div className={"left"}>
                {content_left}
            </div>

            <div className={"right"}>
                {content_right}
            </div>
        </Nav>
    )
}

function NavItem(title, id){
    const props = {activeKey: id, href: "#"+id };

    return (
        <Nav.Item>
            <Nav.Link {...props}> {title} </Nav.Link>
        </Nav.Item>
    )
}

export default Navbar
